import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      Pretty Cool Haircut Podcast Homepage


      </header>
        <body>
        Episodes:

        <div class="box red">
            Episode 1
        </div>
        <p></p>
        <div className="box red">
            Episode 2
        </div>
        <p></p>

        <div className="box red">
            Episode 3
        </div>
        </body>
    </div>
  );
}

export default App;
